import React from "react";
import "../../styles/home.css";
import { Container, Row, Col } from "reactstrap";
import heroImg from "../../assets/images/hero-img01.jpg";
import heroImg02 from "../../assets/images/hero-img02.jpg";
import heroVideo from "../../assets/images/hero-video.mp4";
import worldImg from "../../assets/images/world.png";
import Subtitle from "../../shared/Subtitle";
const Home = () => {
  return (
    <>
      {/* ============== hero section start ============= */}
      <section>
        <Container>
          <Row>
            <Col lg="6">
              <div className="hero_content">
                <div className="hero_subtitle d-flex adlign-items-center">
                  <Subtitle subtitle={"Know before you go"} />
                  <img src={worldImg} alt="worldImg" />
                </div>
                <h1>
                  Traveling opens the door to creating{" "}
                  <span className="highlight">memories</span>
                </h1>
                <p>
                  Lorem ipsum dolor, sit amet consectetur adipisicing elit.
                  Incidunt error, nesciunt quam ipsum dignissimos voluptate
                  vitae, beatae eius reprehenderit perspiciatis cum itaque
                  expedita eveniet ad blanditiis harum eligendi. Quae aspernatur
                  esse voluptatum ipsum.
                </p>
              </div>
            </Col>
            <Col lg="2">
              <div className="hero_img-box">
                <img src={heroImg} alt="heroImg" />
              </div>
            </Col>
            <Col lg="2">
              <div className="hero_img_box">
                <video src={heroVideo} alt="heroVideo" controls />
              </div>
            </Col>
            <Col lg="2">
              <div className="hero_img_box">
                <img src={heroImg02} alt="heroImg02" />
              </div>
            </Col>
          </Row>
        </Container>
      </section>
      {/* ============== hero section end ============= */}
    </>
  );
};

export default Home;
